  - - '16'
    - '2012-09-12'
    - Elbows underneath the bar at the same time feet hit the floor.  Be smooth and
      continuous from the bottom of the catch and moving up.  Split jerk with feet
      further apart.  Make sure I split far apart with light weight to practice the
      correct position for heavier weight.  I didn't split far enough on my heaver
      weight jerks.  Straight up and down on clean pulls like I'm jumping straight
      up into the air.
    - '2012-09-13 01:34:32.275915'
    - '2012-09-13 02:15:13.784662'
  - - '17'
    - '2012-09-15'
    - For snatches, more zip on top and control the catch.  Bounce out of the clean
      but not the snatch.  Move feet horizontally and don't hop up vertically.  Doing
      well snatching straight up and down.  Start doing snatches from block.  I'm
      missing the last part of the pull and finish and jumping down too soon.  Yearly
      snatch PR at 57.5!  Do snatch pulls with the same energy as doing full snatches.
    - '2012-09-15 19:14:35.733358'
    - '2012-09-15 20:00:40.861423'
  - - '18'
    - '2012-09-17'
    - Elbows under quickly for Clean.  Getting ready for the Jerk, elbows down.  Keep
      chest up through beginning and end of Clean.  I have a tendency to lean forward
      and extend my hips while keeping my chest face down.  Top of the chest up the
      entire time like the guys on the wall.  Bar should be around hips not legs during
      pull.  Stick jerk and hold for 3 seconds.  Pull very slowly off the floor.  Straight
      up pulling, I have a tendency to lean backwards.
    - '2012-09-18 01:17:12.648869'
    - '2012-09-18 02:17:02.089256'
  - - '19'
    - '2012-09-19'
    - Don't get way down and sit with bent knees before lifting.  It cuts off blood
      flow and makes it harder to get set.  Take one big breath, get tight and go.  Drop
      straight down and catch the snatch at the bottom instead of catching it half
      way and bringing it down gradually.  When snatching, catch and hold for 1 full
      second.  No yanking or bouncing when attempting to use hips and traps.  Be under
      control and use the hips to jump up.
    - '2012-09-20 01:18:33.043514'
    - '2012-09-20 01:41:28.973442'
  - - '20'
    - '2012-09-22'
    - On snatching, loose arms and explosive hips.  On both cleaning and snatching,
      don't hop.  Instead, move feet off the ground as little as possible.  We want
      to be as efficient as possible for the heavy weights.
